        const rankingTable = document.getElementById('rankingTable');
        const filterInput = document.getElementById('filterInput');
        const sortScoreBtn = document.getElementById('sortScoreBtn');
        const sortNameBtn = document.getElementById('sortNameBtn');

        function renderTable(data) {
            rankingTable.innerHTML = '';
            data.forEach((player, index) => {
                const row = document.createElement('tr');
                row.innerHTML = `
                    <th scope="row">${index + 1}</th>
                    <td>${player.name}</td>
                    <td>${player.score}</td>
                    <td><button class="btn btn-primary" onclick="showProfile('${player.name}')">View Profile</button></td>
                `;
                rankingTable.appendChild(row);
            });
        }

        function showProfile(name) {
            const player = data.find(player => player.name === name);
            const modalBody = document.getElementById('modalBody');
            modalBody.innerHTML = `
   <div class="container row" >
                    <div class="col-md-6">
                        <img src="${player.profile.image[0]}" alt="${player.name}" class="img-fluid" >
                        </div>
                    <div class="col-md-6" >
                        <div class="col-md-3">
                             <img src="${player.profile.image[1]}" alt="${player.name}" class="img-fluid" >
                            </div>
                        <div class="col-md-3">
                             <img src="${player.profile.image[2]}" alt="${player.name}" class="img-fluid"  >
                            </div>
                    </div>
                   </div>
              
                <p>${player.profile.goals}${player.profile.internationalGoals}${player.profile.awards}${player.profile.currentRanking}${player.profile.singleSeasonHighs}${player.profile.highestScoringRecords}${player.profile.description}</p>
              
               
            `;
            const profileModal = new bootstrap.Modal(document.getElementById('profileModal'));
            profileModal.show();
        }

        function filterTable() {
            const filterValue = filterInput.value.toLowerCase();
            const filteredData = data.filter(player =>
                player.name.toLowerCase().includes(filterValue)
            );
            renderTable(filteredData);
        }

        function sortTableByScore() {
            const sortedData = [...data].sort((a, b) => b.score - a.score);
            renderTable(sortedData);
        }

        function sortTableByName() {
            const sortedData = [...data].sort((a, b) => a.name.localeCompare(b.name));
            renderTable(sortedData);
        }

        // Initial table render
        renderTable(data);

        // Event Listeners
        filterInput.addEventListener('input', filterTable);
        sortScoreBtn.addEventListener('click', sortTableByScore);
        sortNameBtn.addEventListener('click', sortTableByName);
   